import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
import Card from "./components/Cards";

function App() {
  return (
    <Wrapper>
      <Title>Friends List</Title>
      <Card name="Spongebob" occupation="Fry Cook" location="A Pineapple Under the Sea" imgsrc="https://upload.wikimedia.org/wikipedia/en/thumb/4/47/Spongebob-squarepants.svg/666px-Spongebob-squarepants.svg.png" />
      <Card name="Mr Krabs" occupation="Restaurant Owner" location="A Giant Anchor" imgsrc="https://vignette3.wikia.nocookie.net/vsbattles/images/8/80/Mr._Krabs.png/revision/latest?cb=20150919162131" />
      <Card name="Squidward" occupation="Duce" location="A Pineapple Under the Sea" imgsrc="https://upload.wikimedia.org/wikipedia/en/thumb/4/47/Spongebob-squarepants.svg/666px-Spongebob-squarepants.svg.png" />
    </Wrapper>
  );
}

export default App;
